from collections import Counter

def isAnagram(s0, s1):
    if len(s0) != len(s1):
        return False
    p = Counter(s0)
    print(p['a'])
    q = Counter(s1)

    return p == q


def solve(matrix):
    # Write your code here
    res = 0
    rows = len(matrix)
    cols = len(matrix[0])

    for i in range(rows):
        for j in range(cols):
            res += isLargest(matrix[i][j], matrix, i, j, rows, cols)
    return res


def isLargest(n, matrix, r, c, rows, cols):
    r1 = all(True if matrix[i][c] <= n else False for i in range(rows))
    r2 = all(True if matrix[r][j] <= n else False for j in range(cols))
    if r1 and r2:
        return 1
    else:
        return 0

